import React, { useState } from "react";
import axios from 'axios';
// reactstrap components
import { Button, Container, Row, Col } from "reactstrap";

// core components

function Suggest() {
  const [names,setNames]=useState([]);
  const item =axios.get('http://api.visitkorea.or.kr/openapi/service/rest/DataLabService/metcoRegnVisitrDDList?serviceKey=ZyXbs3ggoxjvBgNnPZIbqucXxkimzEhCbTUf2TCX6PoRp%2BTOPYloYNtCYjVBaZzDEm8tpcfCZJW6RVoIRejKpg%3D%3D&MobileOS=ETC&MobileApp=AppTest&startYmd=20210513&endYmd=2021513&_type=json')

  
    .then((Response)=>{setNames([Response.data.response.body.items.item[1]])})
  
  
    //setNames({name:Response.data.response.body.items.item[1].areaNm, daywkDivNm:Response.data.response.body.items.item[1].daywkDivNm})})
  .catch((Error)=>{console.log(Error)});
  
  console.log(names);
  return ( names.map((item)=>
  
    <>
      <div className="section section-nucleo-icons">
        <Container>
          <Row >
            <Col lg="6" md="12">
              <h2 className="title" style={{color:"black"}}>  {item.name}</h2>
              <h5 className="description">
                방문자 수 {item.daywkDivNm} (+설명  )
              </h5>
              <Button
                className="btn-round mr-1"
                color="info"
                href="/nucleo-icons"
                size="lg"
                target="_blank"
              >
                자세히
              </Button>
              <Button
                className="btn-round"
                color="info"
                href="https://nucleoapp.com/?ref=1712"
                outline
                size="lg"
                target="_blank"
              >
                길찾기
              </Button>
            </Col>
          </Row>
        </Container>
      </div>
    </>
    )
  );
}

export default Suggest;
